import React from 'react';
import './Header.css'; 
import logo from '../../Assets/logo.png';


const Header = () => {
  return (
    <header className="header">
      
      <div className="logo">
        <img src={logo} alt="Logo" />
      </div>
    </header>
  );
};

export default Header;
